import React from 'react';
import Task from './task';

const Tasks = [{'name': "task1", "isComplete": "false", "id": "1"}, {'name': "task2", "isComplete": "true", "id": "2"}];
function App() {
  var t = [];
  for(var i = 0; i < Tasks.length; i++) {
    t.push(<Task task={Tasks[i]}></Task>);
  }
  return(
    <div>
      <h1>My Todos</h1>
      <div>{t}</div>
    </div>
  );
}

export default App;
